import styled from "styled-components/native";
import { View } from "react-native";

const positionVariant = {
  top: "marginTop",
  left: "marginLeft",
  right: "marginRight",
  bottom: "marginBottom",
};


export const Spacer = styled(View)`
  ${({ position, size })  `
   ${positionVariant[position]}: ${alignPosition}:${size}
  `}
`;

Spacer.defaultProps = {
  position: "right",
  size: "8px",
};
